import React from 'react';
import { AsyncStorage, Image, StyleSheet, Text, Button } from 'react-native';
import {View} from "react-native-web";
import Background from "./Background";
import Facebook from "expo-facebook";
export default function Login(props){
    const [token,setToken] = React.useState(null);
    React.useEffect(()=>{
        AsyncStorage.getItem('token', (token)=>{
            if(token){
                props.navigator.navigate('/CaroselView')
            }
        })
    },[]);
    const login = () => {
        Facebook.initializeAsync('903509873444766').then()
        AsyncStorage.setItem('token', 'RAndomwFakeToken');
        props.navigator.navigate()
    }
    return(
        <View style={{flex:1}}>
            <Background/>
            <View style={styles.container}>
                <Button onClick={login} style={styles.getStarted}>Get Started</Button>
            </View>
        </View>
    )
}
const styles = StyleSheet.create(
    {
        getStarted: {
            fontFamily: "Helvetica",
            fontSize: 14,
            color: "#FFFFFF",
            letterSpacing: 0,
            textAlign: "center",
        },
        container: {
            //flexDirection: "column",
            height: 48,
            width: 375,
            justifyContent: "center",
            backgroundColor: "#0F8CFF",
            opacity: 100,

        },
    }
)
